    constructor(props){
        super(props)
        this.state={}
    }

    render(){
        return (
            <>
            <div style={{display:"flex", flexDirection :"row",flex: 1}}>
                <div style={{display:"flex", flexDirection:"column"}}>
                    {left.map(item => (
                        <div>{item.title}</div>
                    ))}
                </div>
                <div style={{display:"flex", flexDirection:"column"}}></div>
                <div style={{display:"flex", flexDirection:"column"}}></div>
            </div>
            </>
        )
    }
}
export default Animation
